import React from 'react';
import { Form } from 'react-bootstrap';

const Checkout = () => {
  return (
    <div className='Checkout'>
      <h1>Checkout</h1>
      <Form>
        {['radio'].map((type) => (
          <div key={`inline-${type}`} className="mb-3">
            <Form.Check
              inline
              label="Auf Rechnung zahlen"
              name="bill"
              type={type}
              id={`inline-${type}-1`}
            />
          </div>
        ))}
                {['radio'].map((type) => (
          <div key={`inline-${type}`} className="mb-3">
            <Form.Check
              inline
              label="Kredit-/Debitkarte"
              name="card"
              type={type}
              id={`inline-${type}-1`}
            />
          </div>
        ))}
                {['radio'].map((type) => (
          <div key={`inline-${type}`} className="mb-3">
            <Form.Check
              inline
              label="TWINT"
              name="twint"
              type={type}
              id={`inline-${type}-1`}
            />
          </div>
        ))}
                {['radio'].map((type) => (
          <div key={`inline-${type}`} className="mb-3">
            <Form.Check
              inline
              label="Apple Pay"
              name="apple"
              type={type}
              id={`inline-${type}-1`}
            />
          </div>
        ))}
      </Form>
    </div>
  );
};

export default Checkout;
